#define ROOT_SVN_REVISION 22606
#define ROOT_SVN_BRANCH "trunk"
#define ROOT_VERSION_CODE 332547
#define ROOT_VERSION(a,b,c) (((a) << 16) + ((b) << 8) + (c))

#endif
